// src/utils.ts
function selectFile(contentType, multiple = false) {
  return new Promise((resolve) => {
    let input = document.createElement("input");
    input.type = "file";
    input.multiple = multiple;
    input.accept = contentType;
    input.onchange = (_) => {
      let files = Array.from(input.files);
      if (multiple)
        resolve(files);
      else
        resolve(files);
    };
    input.click();
  });
}

